import UsuarioForm from "@/components/UsuarioForm.vue";
import { api } from "@/services.js";
export default {
  name: "UsuarioEditar",
  components: {
    UsuarioForm: UsuarioForm
  },
  methods: {
    atualizarUsuario: function atualizarUsuario() {
      var _this = this;

      api.put("/usuario/".concat(this.$store.state.usuario.id), this.$store.state.usuario).then(function () {
        _this.$store.dispatch("getUsuario");

        _this.$router.push({
          name: "usuario"
        });
      }).catch(function (error) {
        console.log(error.response);
      });
    }
  }
};
